import React from "react";
import { Link } from "react-router-dom";
import "../assets/sty_home.css";

function Navbar() {
  return (
    <>
      <nav className="navbar">
        <Link to="/" className=""></Link>
      </nav>
    </>
  );
}

export default Navbar;
